window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"10.6.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"darwin","version":"21.6.0"},"runtime":{"name":"node.js","version":"21.7.0"}}},{"source":{"data":"Feature: Crear page\n\n    @run @pages\n    Scenario: Crear una page con un título y un audio\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba\" como nombre de la página\n        And agrego un audio a la página\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And el audio se agregó correctamente\n\n    @run @pages @v5\n    Scenario: Crear una page con un título, un párrafo y un video embebido de YouTube\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Página de prueba YT\" como nombre de la página\n        And ingreso \"contenido de la página con link a youtube\" como contenido de la página\n        And agrego un video embebido de YouTube con link \"https://www.youtube.com/watch?v=edVYLVDDgh0\"\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And el video se agregó correctamente\n\n    @run @pages @v5\n    Scenario: Crear una page básica con una URL definida (slug)\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba con slug\" como nombre de la página\n        And abro las configuraciones de la página\n        And cambio el slug de la página por \"slug-de-prueba\"\n        And cierro las configuraciones de la página\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And puedo navegar a la URL con el slug asignado\n\n    @run @pages @debug @v5\n    Scenario: Crear una page básica, previsualizarla y dejarla en borrador\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba con preview\" como nombre de la página\n        And ingreso \"contenido de la página con preview\" como contenido de la página\n        When ingreso a la previsualización\n        Then puedo previsualizar correctamente la página\n        And salgo de la previsualización\n        When guardo el borrador de la página\n        Then la página debe existir en la lista\n        And la página debe tener el estado \"Draft\"","uri":"step_definitions/features/crear-page.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear page","description":"","children":[{"scenario":{"id":"fe508e18-30a0-4e1a-a9f8-0fd50290cf3e","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"2aad4be1-c419-4f4c-9c62-4705a6928d94"},{"location":{"line":3,"column":10},"name":"@pages","id":"b82402e0-3494-44ad-b7c3-727ec245a406"}],"location":{"line":4,"column":5},"keyword":"Scenario","name":"Crear una page con un título y un audio","description":"","steps":[{"id":"0ef76cdd-00e5-4658-8427-cffdb8e688ed","location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"inicio la aplicación"},{"id":"b956a807-cd05-44f5-93bc-97bc4cf6a6f7","location":{"line":6,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"inicio sesión si es necesario"},{"id":"3493f17c-e3c6-4769-87a9-a29e82b34c37","location":{"line":7,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"abro la sección de \"Pa     @run @tags \n    Scenario: Crear tag con una imagen\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Tags\"\n        And doy click en \"New tag\"\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\n        And agrego una imagen al tag\n        When guardo el tag\n        Then el tag se guarda exitosamente\n        And abro la sección de \"Tags\"\n        And el tag se encuentra en la lista\n        And abro la página del tag\n        And el tag debe tener la imagen\n\n    @run @tags @v5\n    Scenario: Crear tag con Meta Data\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Tags\"\n        And doy click en \"New tag\"\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\n        And ingreso datos de meta data con título \"Metatitulo\" y descripción \"MetaDesc\"\n        When guardo el tag\n        Then el tag se guarda exitosamente\n        And abro la sección de \"Tags\"\n        And el tag se encuentra en la lista\n        And abro la página del tag\n        And el tag debe contener la información de meta data\n","uri":"step_definitions/features/crear-tag.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear Tag","description":"","children":[{"scenario":{"id":"ed78f387-e596-4c7e-bec5-c8102620526a","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"db97adb3-7ed5-47bd-8227-2560511260f5"},{"location":{"line":3,"column":10},"name":"@tags","id":"b4e49d53-33df-4cdd-af1a-38ab4fca7d72"},{"location":{"line":3,"column":16},"name":"@v5","id":"745161b1-4233-45f0-ab20-4b64be6dea3f"}],"location":{"line":4,"column":5},"keyword
